#胡歌好像我的显眼包同学#
@胡歌 的显眼包属性是不是不打算藏了？！昨天《花样年华》重映首映礼，本以为又要见到惊艳整个上海滩的宝总了，没想到胡歌没藏好“本尊”上演了一场 “变如脸” 大戏~躲着大家偷笑，好笑程度100%，偷笑被抓包，好笑程度1000000%！
