#新春万象新 精彩中国年#
新春佳节，大江南北洋溢着欢乐祥和的节日氛围。在亿万家庭欢度春节之时，广大供电员工坚守一线，贴心服务，用心用情守护万家灯火。春节期间，本报记者深入基层一线，实地感受电力人的别样年味儿，记录这个春天里的团聚、欢乐、收获和坚守。
@国网江苏电力 @国网山东电力  ​

